if mibBuilder.loadTexts: ldapUserSearchBaseDN.setDescription('As part of the user authentication process, it is necessary to search the LDAP server for one or more attributes associated with a particular user. Any search request must specify the base DN for the actual search. This field specifies the base DN which should be used to search the User directory. An example might look like cn=users,dn=foobar,dn=com. If this field is left blank, the Root DN will be used as the search base instead. As mentioned, user searches are part of the authentication process. They are carried out to retrieve information about the user such as login permissions, callback number, and group memberships. For Version 2.0 LDAP clients, it is strongly encouraged that this parameter be configured, otherwise a search using the root DN may not succeed (as seen on Active Directory servers).')
ldapGroupFilter = MibScalar((1, 3, 6, 1, 4, 1, 2, 3, 51, 2, 4, 9, 3, 6, 9), OctetString().subtype(subtypeSpec=ValueSizeConstraint(0, 64))).setMaxAccess("readwrite")
if mibBuilder.loadTexts: ldapGroupFilter.setStatus('mandatory')
if mibBuilder.loadTexts: ldapGroupFilter.setDescription('This filter is used for group authentication. It specifies what group or groups that this MM belongs to. If left blank, group authentication is disabled. Otherwise, group authentication will be performed against the filter. The filter can be a specific group name (eg. RSAWest), a wildcard (*) which matches everything, or a wildcard with a prefix (eg. RSA*). The default filter is RSA*. After user authentication, group authentication will take place, whereby an attempt will be made to match the group or groups (that the user belongs to) to the group filter defined here. If there is no match, the user will not pass authentication and will be blocked. If there is a match, the login permissions for the user will be retrieved from the matched group(s), unless the user already has login permissions assigned directly from the user record retrieved from the LDAP server.')
ldapBindingMethod = MibScalar((1, 3, 6, 1, 4, 1, 2, 3, 51, 2, 4, 9, 3, 6, 10), Integer32().subtype(subtypeSpec=ConstraintsUnion(SingleValueConstraint(0, 1, 2, 3))).clone(namedValues=NamedValues(("anonymousAuthentication", 0), ("clientAuthentication", 1), ("userPrincipalName", 2), ("strictUserPrincipalName", 3)))).setMaxAccess("readwrite")
if mibBuilder.loadTexts: ldapBindingMethod.setStatus('mandatory')
if mibBuilder.loadTexts: ldapBindingMethod.setDescription("On initial binds to the LDAP server during user authentication, there are three options: Anonymous authentication: Bind attempt is made without a client DN or password. If the bind is successful, a search will be requested in order to find an entry on the LDAP server for the user attempting to login. If an entry is found, a second attempt to bind will be attempted, this time with the user's DN and password. If this succeeds, the user is deemed to have passed the user authentication phase. Group authentication is then attempted if it is enabled. Client authentication: Bind attempt is made with client DN and password specified by this configuration parameter. If the bind is successful, we proceed as above. User Principal Name (UPN): Bind attempt is made directly with the credentials used during the login process. If this succeeds, the user is deemed to have passed the user authentication phase. Note that for Active Directory servers, the userid can have the form someuser@somedomain or simply someuser. Strict UPN: This is the same as UPN above, except that the userid must have the form someuser@somedomain. The string entered by the user will be parsed for the @ symbol.")
ldapClientAuthenticationDN = MibScalar((1, 3, 6, 1, 4, 1, 2, 3, 51, 2, 4, 9, 3, 6, 11), OctetString().subtype(subtypeSpec=ValueSizeConstraint(0, 64))).setMaxAccess("readwrite")
